import React from 'react';
import PropsType from 'prop-types';
import './footer-info.css';

const FooterInfo = ({label, className, clearCompletedTask}) =>{
    return <span onClick={clearCompletedTask} className={className}>{label}</span>
}
FooterInfo.defaultProps = {
    onClick: ()=>{},
    className: "clear-completed",
    label: "Clear completed"
}
FooterInfo.propsType = {
    onClick: PropsType.func.isRequired,
    className: PropsType.string.isRequired,
    label: PropsType.string.isRequired
}


export default FooterInfo;
